import React from "react";
import styled from 'styled-components';

const Pdiv =styled.div` 
  margin: auto;
  text-align: justify;
  color:#778899
  `


const Text = () =>{


return(
  <Pdiv>
    Frontend Dev olarak hala position kullaniyorsan bu çok acı pizza tam sana göre. Pizza, domates,peynir ve genellikle çeşitli diğer malzemelerle kaplanmış, daha sonra geleneksel olarak odun ateşinde bir fırında yüksek sıcaklıkta pişirilen, genellikle yuvarlak, düzleştirilmiş mayalı buğday bazlı hamurdan oluşan italyan kökenli lezzetli bir yemektir.. Küçük bir pizzaya bazen pizzetta denir.
  </Pdiv>


)
}

export default Text;
